import "./Titulo.css";

export default function Titulo({title, text}) {
    return (
        <div className="container" style={{border: '1px solid #d3d3d3'}}>
            <div className="pricing-header px-3 py-3 pt-md-5 pb-md-4 mx-auto text-center" style={{padding: '0px 0px, 0px'}}>
                <h1 className="display-4">{title}</h1>
                <p className="lead" style={{marginBottom:'0px'}}>{text}</p>
            </div>
        </div>
    )
}
